import './App.css';

function App() {
  return (
    <div className="App">
      <div className="container">
        <h1 className="heading">Todo App</h1>
        <h2 className="subhead">Enter todos..</h2>
        <form >
          <input type="text"
           className="todo_input"
           name='text'
           autoComplete='off' 
           />
           <button type='submit' className="add_button"></button>
        </form>

      </div>

    </div>
  );
}

export default App;
